import { useNavigate, useRef } from 'react';
import axios from 'axios';

export const AddFLight = () => {
    const FlightNumberRef = useRef();
    const DepartureDateRef = useRef([]);
    const ArrivalDateRef = {
        DayRef = useRef(),
        MonthRef = useRef(),
        YearRef = useRef()
    } = useRef();
    const DepartureTimeRef = {
        HourRef = useRef(),
        MinuteRef = useRef(),
        IsBeforeMiddayRef = useRef()
    } = useRef();
    const ArrivalTimeRef = {
        HourRef = useRef(),
        MinuteRef = useRef(),
        IsBeforeMiddayRef = useRef()
    } = useRef();
    const DepartureAirportRef = {
        AirportNameRef = useRef(),
        AirportTagRef = useRef()
    } = useRef();
    const ArrivalAirportRef = {
        AirportNameRef = useRef(),
        AirportTagRef = useRef()
    } = useRef();
    const PassengerCountRef = useRef();
    const PassengerLimitRef = useRef();
    const navigate = useNavigate();
    const handleSubmit = async (event) => {
        try {
            await axios.post('http://localhost:8085/flights', {FlightNumber: FlightNumberRef.currentValue, DepartureDate: DepartureDateRef.currentValue, ArrivalDate: ArrivalDateRef.currentValue,
                                                                DepartureTime: DepartureTimeRef.currentValue, ArrivalTime: ArrivalTimeRef.currentValue, DepartureAirport: DepartureAirportRef.currentValue,
                                                                ArrivalAirport: ArrivalAirportRef.currentValue, PassengerCount: PassengerCountRef.currentValue, PassengerLimit: PassengerLimitRef.currentValue});
            navigate('../', {replace: true});
        } catch (error) {
            console.log(error);
        }
    }

    return(
        <form className = "MyForm" onSumbit = {handleSubmit}>
            <div>
                <label htmlFor="FlightNumber">Flight Number</label><div><input type = "text" id="FlightNumber" ref={FlightNumberRef}/></div>

                <label htmlFor="DepartureDateDay">Departure Date: Day</label><div><input type = "text" id="DepartureDateDay" ref={DepartureDateRef.DayRef}/></div>
                <label htmlFor="DepartureDateMonth">Departure Date: Month</label><div><input type = "text" id="DepartureDateMonth" ref={DepartureDateRef.MonthRef}/></div>
                <label htmlFor="DepartureDateYear">Departure Date: Year</label><div><input type = "text" id="DepartureDateYear" ref={DepartureDateRef.YearRef}/></div>
                
                <label htmlFor="ArrivalDateDay">Arrival Date: Day</label><div><input type = "text" id="ArrivalDateDay" ref={ArrivalDateRef.DayRef}/></div>
                <label htmlFor="ArrivalDateMonth">Arrival Date: Month</label><div><input type = "text" id="ArrivalDateMonth" ref={ArrivalDateRef.MonthRef}/></div>
                <label htmlFor="ArrivalDateYear">Arrival Date: Year</label><div><input type = "text" id="ArrivalDateYear" ref={ArrivalDateRef.YearRef}/></div>

                <label htmlFor="DepartureTimeHour">Departure Date: Hour</label><div><input type = "text" id="DepartureTimeHour" ref={DepartureTimeRef.HourRef}/></div>
                <label htmlFor="DepartureTimeMinute">Departure Date: Minute</label><div><input type = "text" id="DepartureTimeMinute" ref={DepartureTimeRef.MinuteRef}/></div>
                <label htmlFor="DepartureTimeIsBeforeMidday">Departure Date: A.M. (True/False) </label><div><input type = "text" id="DepartureTimeIsBeforeMidday" ref={DepartureTimeRef.IsBeforeMiddayRef}/></div>

                <label htmlFor="ArrivalTimeHour">Arrival Date: Hour</label><div><input type = "text" id="ArrivalTimeHour" ref={ArrivalTimeRef.HourRef}/></div>
                <label htmlFor="ArrivalTimeMinute">Arrival Date: Minute</label><div><input type = "text" id="ArrivalTimeMinute" ref={ArrivalTimeRef.MinuteRef}/></div>
                <label htmlFor="ArrivalTimeIsBeforeMidday">Arrival Date: A.M. (True/False) </label><div><input type = "text" id="ArrivalTimeIsBeforeMidday" ref={ArrivalTimeRef.IsBeforeMiddayRef}/></div>

                <label htmlFor="DepartureAirportName">Departure Airport: Name</label><div><input type = "text" id="DepartureAirportName" ref={DepartureAirportRef.AirportNameRef}/></div>
                <label htmlFor="DepartureAirportTag">Departure Airport: Tag</label><div><input type = "text" id="DepartureAirportTag" ref={DepartureAirportRef.AirportTagRef}/></div>

                <label htmlFor="ArrivalAirportName">Arrival Airport: Name</label><div><input type = "text" id="ArrivalAirportName" ref={ArrivalAirportRef.AirportNameRef}/></div>
                <label htmlFor="ArrivalAirportTag">Arrival Airport: Tag</label><div><input type = "text" id="ArrivalAirportTag" ref={ArrivalAirportRef.AirportTagRef}/></div>

                <label htmlFor="PassengersCount">Number of Passengers</label><div><input type = "text" id="PassengersCount" ref={PassengerCountRef}/></div>
                <label htmlFor="PassengersLimit">Limit Of Passengers</label><div><input type = "text" id="PassengersLimit" ref={PassengerLimitRef}/></div>
                
                <input type="submit" value="Add Flight"/>
            </div>
        </form>
    )
}
